ee dictionary.</td> </tr> </table> <p><b>Kisa</b> or <b>KISA</b> may refer to:</p> <div style="clear: right; margin-bottom: .5em; float: right; padding: .5em 0 .8em 1.4em; background: none; width: auto;"> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#People"><span class="tocnumber">1</span> <span class="toctext">People</span></a></li> <li class="toclevel-1 tocsection-2"><a href="#Places"><span class="tocnumber">2</span> <span class="toctext">Places</span></a></li> <li class="toclevel-1 tocsection-3"><a href="#Organizations"><span class="tocnumber">3</span> <span class="toctext">Organizations</span></a></li> <li class="toclevel-1 tocsection-4"><a href="#Other_uses"><span class="tocnumber">4</span> <span class="toctext">Other uses</span></a></li> </ul> </div> </div> <h2><span class="mw-headline" id="People">People</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Kisa&amp;action=edit&amp;section=1" title="Edit section: People">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Janet_Kisa" title="Janet Kisa">Janet Kisa</a> (born 1992), Kenyan runner</li> <li><a href="/wiki/Kisa_Gotami" title="Kisa Gotami">Kisa Gotami</a>, disciple of Buddha</li> <li><a href="/wiki/Rostislav_Ki%C5%A1a" title="Rostislav Kiša">Rostislav Kiša</a> (born 1978), Czech footballer</li> </ul> <h2><span class="mw-headline" id="Places">Places</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Kisa&amp;action=edit&amp;section=2" title="Edit section: Places">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Khisa" title="Khisa">Khisa</a>, also known as Kisa, a village in Botswana</li> <li><a href="/wiki/Kisa,_Hiroshima" title="Kisa, Hiroshima">Kisa, Hiroshima</a>, a former town in Hiroshima Prefecture, Japan, now merged with Miyoshi <ul> <li><a href="/wiki/Kisa_Station" title="Kisa Station">Kisa Station</a>, a train station in Miyoshi</li> </ul> </li> <li><a href="/wiki/Kisa,_Iran" class="mw-redirect" title="Kisa, Iran">Kisa, Iran</a>, a village in Hormozgan Province, Iran</li> <li><a href="/wiki/Kisa,_Sweden" title="Kisa, Sweden">Kisa, Sweden</a>, a town in Östergötland County, Sweden</li> </ul> <h2><span class="mw-headline" id="Organizations">Organizations</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Kisa&amp;action=edit&amp;section=3" title="Edit section: Organizations">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Kisa_BK" title="Kisa BK">Kisa BK</a>, a Swedish football club</li> <li><a href="/wiki/KISA-LD" title="KISA-LD">KISA-LD</a>, a low-power television station (channel 40) licensed to serve San Antonio, Texas, United States</li> <li><a href="/wiki/KISA_(NGO)" title="KISA (NGO)">KISA (NGO)</a>, the Movement for Equality, Support, Anti-Racism (Greek: Κίνηση για Ισότητα, Στήριξη, Αντιρατσισμό, abbreviated to ΚΙΣΑ), a Cypriot non-governmental organization established in 1998</li> <li><a href="/wiki/KISA_Phone" title="KISA Phone">KISA Phone</a>, an Australian telecommunications services provider founded in 2013</li> <li>The <a href="/wiki/Korea_Internet_%26_Security_Agency" title="Korea Internet &amp; Security Agency">Korea Internet &amp; Security Agency</a></li> </ul> <h2><span class="mw-headline" id="Other_uses">Other uses</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Kisa&amp;action=edit&amp;section=4" title="Edit section: Other uses">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Kisa_Sohma" class="mw-redirect" title="Kisa Sohma">Kisa Sohma</a>, a character in the manga and anime <i>Fruits Basket</i></li> <li>"<a href="/wiki/Kisa_the_Cat" title="Kisa the Cat">Kisa the Cat</a